Condition : 45 - Notwithstanding the plans hereby approved, in accordance with the approved phasing plan, prior to occupation of any part of the development, details of: 
- CCTV; 
- General external lighting; 
 - Security lighting; 
- Access control measures for residential core entrances; 
- Bridge lighting 
- No net increase in lux spill levels onto the adjoining local wildlife site and demonstrate how all other landscape features (including but not limited to integrated bird and bat boxes, and soft landscape habitats) provided for biodiversity gain will not be subjected to any light spill. This light spill assessment should also consider lighting from internal sources that will lighten the outside through windows and any other glass features on or around the buildings or within the site. The details shall include the location and full specification of all lighting and include an assessment of the impact of any such lighting on the surrounding residential and natural environment. Prior to occupation of any of the residential units, details of a post installation inspection of external light levels shall be submitted to and approved in writing to demonstrate that the built project meets the projected light level levels. The development shall be carried out strictly in accordance with the details so approved and shall be maintained as such thereafter. 
Reason: To safeguard the security of the development and to ensure that any resulting general or security lighting and CCTV are appropriately located, designed to not adversely impact on neighbouring residential amenity or ecology, and are appropriate to the overall design of the development in accordance with policies 7.3, 7.4, 7.6 and 7.19 of the London Plan and Policy DMS1 and DMO4 of the Wandsworth Local Plan.
